import React from 'react';
import Tarjeta from '../elementos/Tarjeta';

// Colores comerciales comunes
export const COLORES_COMERCIALES = [
  'Negro',
  'Blanco',
  'Gris',
  'Azul marino',
  'Rojo',
  'Verde'
];

// Tallas estándar disponibles
export const TALLAS_STD = ['S', 'M', 'L', 'XL'];

// Catálogo de boxers con colores y tallas añadidos
export const productos = [
  {
    id: 1,
    nombre: 'Boxer algodón clásico',
    descripcion: 'Boxer clásico en algodón 95% con ajuste cómodo y pretina elástica.',
    precio: 100,
    colores: COLORES_COMERCIALES,
    tallas: TALLAS_STD,
    imagen: 'https://www.dafiti.com.co/3-Pack-De-Boxer-En-Algodon-Low-Rise-Trunk-Para-Hombre-Calvin-Klein-1791576.html'
  },
  {
    id: 2,
    nombre: 'Boxer microfibra deportivo',
    descripcion: 'Tejido de microfibra transpirable ideal para actividad física.',
    precio: 200,
    colores: COLORES_COMERCIALES,
    tallas: TALLAS_STD,
    imagen: '/img/boxer/1.jpg'
  },
  {
    id: 3,
    nombre: 'Boxer algodón premium',
    descripcion: 'Algodón pima de alta calidad con costuras planas.',
    precio: 300,
    colores: COLORES_COMERCIALES,
    tallas: TALLAS_STD,
    imagen: '/img/boxer/3.jpg'
  },
  {
    id: 4,
    nombre: 'Boxer mezcla stretch',
    descripcion: 'Combinación de algodón y elastano para máxima libertad de movimiento.',
    precio: 150,
    colores: COLORES_COMERCIALES,
    tallas: TALLAS_STD,
    imagen: '/img/boxer/4.jpg'
  },
  {
    id: 5,
    nombre: 'Boxer sin costuras',
    descripcion: 'Tecnología seamless que evita rozaduras, ideal para uso diario.',
    precio: 250,
    colores: COLORES_COMERCIALES,
    tallas: TALLAS_STD,
    imagen: '/img/boxer/5.jpg'
  },
  {
    id: 6,
    nombre: 'Boxer compresión ligera',
    descripcion: 'Compresión suave para soporte durante el entrenamiento.',
    precio: 350,
    colores: COLORES_COMERCIALES,
    tallas: TALLAS_STD,
    imagen: '/img/boxer/6.jpg'
  }
];

// Componente principal del catálogo
const Catalogo = () => {
  return (
    <div style={{ padding: '20px' }}>
      <h2>Catálogo de Productos</h2>
      <div style={{ display: 'flex', flexWrap: 'wrap' }}>
        {productos.map(producto => (
          <Tarjeta
            key={producto.id}
            imagen={producto.imagen}
            nombre={producto.nombre}
            descripcion={producto.descripcion}
            precio={producto.precio}
          />
        ))}
      </div>
    </div>
  );
};

export default Catalogo;
